import React from 'react';

const Footer = () => {
  return (
    <footer style={{ backgroundColor: '#f8f9fa', padding: '20px', textAlign: 'center' }}>
      <p>&copy; {new Date().getFullYear()} Your Company Name. All Rights Reserved.</p>
    </footer>
  );
};

export default Footer;
